<p>The industry event was organized by Deep Learning Lab (DLL) to showcase their projects to the market industry. The aim of the event was to assess the commercialization potential of the projects being conducted under DLL and have an industry exposure about the relevant products. The event helped in setting the right platform for academia industry linkages and gain better knowledge about the end-user requirements so the research can be steered in the right direction.</p>
<!-- /wp:paragraph -->

<!-- wp:paragraph -->
<p>In this event MOU was signed between "Deep Learning Lab" and "ACRUX Technologies" in the presence of principal SEECS.</p>
